                    var e_1 = new TWEEN.Tween(index.hand.scale).to({ x: 1.09, y: 1.09 }, 400).repeat( 1 ).easing(TWEEN.Easing.Cubic.In).yoyo( true )
                    setTimeout(function() {
                        e.start()
                        e_1.start()
                        new TWEEN.Tween(index.hand).to({ alpha: 0 }, 300).easing(TWEEN.Easing.Linear.None).delay(750).start()   
                    }, 750)
                })
                setTimeout(function() {
                    tmr.start()
                }, 0)



            game.input.onDown = function(x, y) {
               // console.log(x, y)
                //var t = {index.install_btn.x:}
                if (utils.contains(x, y, index.install_button)) {

                setTimeout(function() {
                    if (GPP_OPTION.playable == "life")
                        ExchangeManager.installPlayableClicked()
                
                    game.showPopup()
                }, 100)
            }
            
            index.createLastPopup()
            ExchangeManager.initializeNetworkRulesOnRender()
        }
    }
    return index
})();
